import { ThemeProvider, Typography } from '@material-ui/core';
import React from 'react';
import Button from '@material-ui/core/Button';

export default function Contact() {

  return (

    <section className="flex-row-contact">
<div className="bg-orange box-contact">
    <Typography variant="h2">Let's meet each other!</Typography></div>
<div>
<Typography>You can direclty choose a time slot in my agenda</Typography>
<Button variant="contained" color="secondary">Schedule a meeting</Button>
    <Typography><a href="mailto:julia.turqueti@gmail.com">julia.turqueti[at]gmail.com</a></Typography>
    <Typography>+33 7 68 61 33 57</Typography>
    <Typography><a href="https://www.linkedin.com/in/julia-turqueti/">If you are more a LinkedIn person you can also InMail me!</a></Typography>
    </div>
    </section>

  );
}
